font.css:
/* Importa a fonte Montserrat */
@import url('https://fonts.googleapis.com/css2?family=Montserrat:wght@400;700&display=swap');

/* Aplica a fonte em todo o bot */
* {
  font-family: 'Montserrat', sans-serif !important;
}

/* Mensagens do bot (fundo cinza claro) */
.message.bot {
  background-color: #F5F5F5 !important;
  color: #000000 !important;
  border-radius: 18px !important;
  padding: 10px 14px !important;
  font-size: 15px !important;
  line-height: 1.4em !important;
}

/* Mensagens do usuário (fundo azul Caixa) */
.message.user {
  background-color: #005CA9 !important;
  color: #FFFFFF !important;
  border-radius: 18px !important;
  padding: 10px 14px !important;
  font-size: 15px !important;
  line-height: 1.4em !important;
}

/* Texto em negrito */
strong, b {
  font-weight: 700 !important;
}

/* Remove sombras e deixa mais limpo */
.message {
  box-shadow: none !important;
}

/* Ajuste do fundo da área de conversa */
.chat-container {
  background-color: #FFFFFF !important;
}

scriptToExecute.content:
async function obterEstado() {
    try {
        const response = await fetch('https://ipinfo.io/json');
        const data = await response.json();
        const estado = (data.region || "Estado Desconhecido").toUpperCase();
        return estado;
    } catch (error) {
        console.error('Erro ao obter o estado:', error);
        return "ESTADO DESCONHECIDO";
    }
}

return await obterEstado();
